INSERT INTO `molajo_content` (`id`, `extension_instance_id`, `catalog_type_id`, `title`, `subtitle`, `path`, `alias`, `content_text`, `protected`, `featured`, `stickied`, `status`, `start_publishing_datetime`, `stop_publishing_datetime`, `version`, `version_of_id`, `status_prior_to_version`, `created_datetime`, `created_by`, `modified_datetime`, `modified_by`, `checked_out_datetime`, `checked_out_by`, `root`, `parent_id`, `lft`, `rgt`, `lvl`, `home`, `customfields`, `parameters`, `metadata`, `language`, `translation_of_id`, `ordering`) VALUES
(1, 5, 100, 'Public', ' ', '', '', '<p>All visitors, regardless of whether or not the visitor is logged on, are members of the <strong>Public</strong> group.</p>', 1, 0, 0, 1, '2012-07-01 12:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2012-07-01 12:00:00', 0, '2012-07-01 12:00:00', 0, '0000-00-00 00:00:00', 0, 0, 3, 1, 17, 1, 0, '{\n"group_web_address":"",\n"group_email_address":"",\n"group_owner":"0",\n"group_collection_id":"0"\n}', '{\r\n    "users_can_join":"0",\r\n    "private_to_group_members":"1",\r\n    "allow_delete_with_members":"0",\r\n    "allow_delete_when_used_with_acl":"0 ",\r\n    "allow_delete":"0",\r\n    "invisible":"1"\r\n}', '{}', 'en-GB', 0, 1),
(2, 5, 100, 'Guest', ' ', '', '', '<p>Visitors who are not logged on are members of the <strong>Guest</strong> group.</p>', 1, 0, 0, 1, '2012-07-01 12:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2012-07-01 12:00:00', 0, '2012-07-01 12:00:00', 0, '0000-00-00 00:00:00', 0, 1, 0, 2, 3, 2, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{\r\n    "users_can_join":"0",\r\n    "private_to_group_members":"1",\r\n    "allow_delete_with_members":"0",\r\n    "allow_delete_when_used_with_acl":"0 ",\r\n    "allow_delete":"0",\r\n    "invisible":"1"\r\n}', '{}', 'en-GB', 0, 2),
(3, 5, 100, 'Registered', ' ', '', '', '<p>Visitors who are logged on are members of the <strong>Registered</strong> group.</p>', 1, 0, 0, 1, '2012-07-01 12:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2012-07-01 12:00:00', 0, '2012-07-01 12:00:00', 0, '0000-00-00 00:00:00', 0, 1, 4, 4, 11, 2, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{\r\n    "users_can_join":"0",\r\n    "private_to_group_members":"1",\r\n    "allow_delete_with_members":"0",\r\n    "allow_delete_when_used_with_acl":"0 ",\r\n    "allow_delete":"0",\r\n    "invisible":"1"\r\n}', '{}', 'en-GB', 0, 3),
(4, 5, 110, 'Author', ' ', '', '', '<p>Author group, typically configured to provide users assigned to the group with the ability to  <strong>create</strong> content, but not update, publish, delete or administer it. Note: use the Resource Options to enable all users to manage content they created.</p>', 0, 0, 0, 1, '2012-07-01 12:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2012-07-01 12:00:00', 0, '2012-07-01 12:00:00', 0, '0000-00-00 00:00:00', 0, 1, 5, 5, 10, 3, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{\r\n    "users_can_join":"0",\r\n    "private_to_group_members":"1",\r\n    "allow_delete_with_members":"0",\r\n    "allow_delete_when_used_with_acl":"0 ",\r\n    "allow_delete":"0",\r\n    "invisible":"1"\r\n}', '{}', 'en-GB', 0, 4),
(5, 5, 110, 'Editor', ' ', '', '', '<p>Editor group, typically configured to provide users assigned to the group with the ability to  <strong>create</strong> and <strong>update</strong> content, but not publish, delete or administer it. Note: use the Resource Options to enable all users to manage content they created.</p>', 0, 0, 0, 1, '2012-07-01 12:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2012-07-01 12:00:00', 0, '2012-07-01 12:00:00', 0, '0000-00-00 00:00:00', 0, 1, 6, 6, 9, 4, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{\r\n    "users_can_join":"0",\r\n    "private_to_group_members":"1",\r\n    "allow_delete_with_members":"0",\r\n    "allow_delete_when_used_with_acl":"0 ",\r\n    "allow_delete":"0",\r\n    "invisible":"1"\r\n}', '{}', 'en-GB', 0, 5),
(6, 5, 110, 'Publisher', ' ', '', '', '<p>Publisher group, typically configured to provide users assigned to the group with the ability to  <strong>create</strong>, <strong>update</strong> and <strong>publish</strong> content, but not delete or administer it. Note: use the Resource Options to enable all users to manage content they created.</p>', 0, 0, 0, 1, '2012-07-01 12:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2012-07-01 12:00:00', 0, '2012-07-01 12:00:00', 0, '0000-00-00 00:00:00', 0, 1, 0, 7, 8, 5, 0, '{\r\n"group_web_address":"",\r\n"group_email_address":"",\r\n"group_owner":"0",\r\n"group_collection_id":"0"\r\n}', '{\r\n    "users_can_join":"0",\r\n    "private_to_group_members":"0",\r\n    "allow_delete_with_members":"0",\r\n    "allow_delete_when_used_with_acl":"0 ",\r\n    "allow_delete":"0",\r\n    "invisible":"1"\r\n}', '{}', 'en-GB', 0, 6),
