(1002, 2, 3200, 'Category 2', '', 'categories', 'category-2', '<p>{mockimage}50,50,box{/mockimage}Eum ex dico saepe tritani. Eripuit denique at nam, mei veniam accusata ad, vis ei wisi expetenda. An congue feugait vivendum his. Nisl munere platonem ad vis, ea timeam laoreet eos. Ea sea erat definiebas. At case nihil eleifend cum, labitur splendide voluptatum nec cu, alii esse dicant eu sed.</p>\r\n{readmore}\r\n<p>Qui solet vidisse principes ne, accusam mnesarchum nec ut. :) Vim possit aliquam ea. Et tibique qualisque sit, amet populo impetus eum et. Ad semper melius sed, oratio ridens vocibus cum ea, at vix suscipit mnesarchum intellegam.</p>\r\n\r\n<p>{mockimage}250,250,box{/mockimage}Mel aperiam praesent at, placerat tincidunt temporibus nec ut, admodum molestie necessitatibus duo eu. Vide fastidii forensibus ne ius, recusabo eleifend similique vim id. In persius argumentum pri, fierent sententiae eu sit. At nec enim libris. Ad mei habemus fierent luptatum.</p>', 0, 0, 0, 1, '2012-07-01 12:00:00', '0000-00-00 00:00:00', 1, 0, 0, '2012-07-01 12:00:00', 1, '2012-07-01 12:00:00', 1, '0000-00-00 00:00:00', 0, 102, 0, 0, 0, 0, 0, '', '\r\n{\r\n    "2":{\r\n\r\n        "criteria_title":"Categories",\r\n        "criteria_display_view_on_no_results":"0",\r\n        "criteria_snippet_length":"200",\r\n        "criteria_status":"",\r\n        "criteria_content_catalog_type_id":"",\r\n        "criteria_menuitem_catalog_type_id":"",\r\n        "criteria_content_extension_instance_id":"",\r\n        "criteria_menuitem_extension_instance_id":"",\r\n\r\n        "mustache":"0",\r\n\r\n        "parent_menuid":"2140",\r\n\r\n        "item_theme_id":"",\r\n        "item_page_view_id":"225",\r\n        "item_page_view_css_id":"",\r\n        "item_page_view_css_class":"",\r\n        "item_template_view_id":"1200",\r\n        "item_template_view_css_id":"",\r\n        "item_template_view_css_class":"",\r\n        "item_wrap_view_id":"2030",\r\n        "item_wrap_view_css_id":"",\r\n  